export const altaMedicoRequest = (data , setMedicoData) => {


    fetch('https://localhost:8080/users/altaMedico', {
        method: "POST",
        user: JSON.stringify(data),
        headers: {
            "Content-Type" : "application/json"
        }
    })
        .then(res =>{ 
            console.log(res)
            setMedicoData(res)
            res.json()})
        .then(res => {

            console.log(res)});


}
